     // \u6784\u5efa next \u6570\u7ec4\uff0c\u6570\u7ec4\u957f\u5ea6\u4e3a\u5339\u914d\u4e32\u7684\u957f\u5ea6\uff08next \u6570\u7ec4\u662f\u548c\u5339\u914d\u4e32\u76f8\u5173\u7684\uff09\n        int[] next = new int[m + 1];\n        // \u6784\u9020\u8fc7\u7a0b i = 2\uff0cj = 0 \u5f00\u59cb\uff0ci \u5c0f\u4e8e\u7b49\u4e8e\u5339\u914d\u4e32\u957f\u5ea6 \u3010\u6784\u9020 i \u4ece 2 \u5f00\u59cb\u3011\n        for (int i = 2, j = 0; i <= m; i++) {\n            // \u5339\u914d\u4e0d\u6210\u529f\u7684\u8bdd\uff0cj = next(j)\n            while (j > 0 && p[i] != p[j + 1]) j = next[j];\n            // \u5339\u914d\u6210\u529f\u7684\u8bdd\uff0c\u5148\u8ba9 j++\n            if (p[i] == p[j + 1]) j++;\n            // \u66f4\u65b0 next[i]\uff0c\u7ed3\u675f\u672c\u6b21\u5faa\u73af\uff0ci++\n            next[i] = j;\n        }\n\n        // \u5339\u914d\u8fc7\u7a0b\uff0ci = 1\uff0cj = 0 \u5f00\u59cb\uff0ci \u5c0f\u4e8e\u7b49\u4e8e\u539f\u4e32\u957f\u5ea6 \u3010\u5339\u914d i \u4ece 1 \u5f00\u59cb\u3011\n        for (int i = 1, j = 0; i <= n; i++) {\n            // \u5339\u914d\u4e0d\u6210\u529f j = next(j)\n            while (j > 0 && s[i] != p[j + 1]) j = next[j];\n            // \u5339\u914d\u6210\u529f\u7684\u8bdd\uff0c\u5148\u8ba9 j++\uff0c\u7ed3\u675f\u672c\u6b21\u5faa\u73af\u540e i++\n            if (s[i] == p[j + 1]) j++;\n            // \u6574\u4e00\u6bb5\u5339\u914d\u6210\u529f\uff0c\u76f4\u63a5\u8fd4\u56de\u4e0b\u6807\n            if (j == m) return i - m;\n        }\n\n        return -1;\n    }\n}\n')))}s.isMDXComponent=!0},8764:(e,n,t)=>{t.d(n,{Z:()=>a});const a=t.p+"assets/images/4-1-76377d314619d560a55f953858749989.png"},26045:(e,n,t)=>{t.d(n,{Z:()=>a});const a=t.p+"assets/images/4-2-b94384083f8545cfdee7f480cbe02764.png"},32508:(e,n,t)=>{t.d(n,{Z:()=>a});const a=t.p+"assets/images/kmp-1-3c78e8e8939e80b3d2b1e43678a590f6.png"},67208:(e,n,t)=>{t.d(n,{Z:()=>a});const a=t.p+"assets/images/kmp-2-84e50705ac190a87b149f2f356fd7b73.png"},97408:(e,n,t)=>{t.d(n,{Z:()=>a});con